import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import About from "../About.js/about";
import User from '../../Assets/User_Prians.png'
import './about_2.css';

const About_2=()=>{
    return(
        <Fragment>
    <div class="card-container">
	<img class="round" src={User} alt="user" />
	<h3>Priyansh Gupta</h3>
	<h6>Kanpur, Uttar Pradesh</h6>
	<p> I am a positive, enthusiastic and competent Web Developer 
            who, over the years, has built up a diverse range of skills,
            qualities and attributes that guarantee I will perform highly in
            this role.</p>
	
	<div class="skill">
		<h6>Skills</h6>
		<ul>
			<li>UI / UX</li>
			<li>Front End Development</li>
			<li>HTML</li>
			<li>CSS</li>
			<li>JavaScript</li>
			<li>ReactJs</li>
		</ul>
	</div>
</div>
        </Fragment>
    );
};

export default About_2;
